import React from 'react';
import AccountNav from '../layout/AccountNav';

const total = Math.round(randomValue(10000));

export const Account = () => {
  return (
    <div>
      <AccountNav />
      <div className='container'>
        <h1>Account Balance - {total}</h1>
      </div>
    </div>
  );
};

export default Account;
